import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-content">
        © 2024 Feurther Technologies LLC. All Rights Reserved.
      </div>
    </footer>
  );
};

export default Footer;
